import React from "react";
import Room from "./room";

const RoomList = rooms => {
    if (rooms.length===0) {
        return (
            <div className="empty-search">
                <h3>Sorry no rooms matched your searched your request</h3>
            </div>
        )
    }
  return <div>Room List</div>;
};

export default RoomList;
